import { StatusBar } from 'expo-status-bar';
import React, { useReducer, useContext } from 'react';
import { StyleSheet, View, Button } from 'react-native';
import RatingPage from './pages/RatingPage';
import { Game } from './pages/Game';
import LevelFirst from './levels/LevelFirst'
import LevelSecond from './levels/LevelSecond'
import LevelThird from './levels/LevelThird'
import LevelFourth from './levels/LevelFourth'
import LevelFifth from './levels/LevelFifth'
import LevelSixth from './levels/LevelSixth'
import LevelSeventh from './levels/LevelSeventh'
import LevelEight from './levels/LevelEight'
import LevelNinth from './levels/LevelNinth'
import LevelTenth from './levels/LevelTenth'


export const CountContext = React.createContext()

const initialState = <LevelEight />;

const reducer = (state, action) => {
  switch (action) {
    case '1':
      return state === <LevelFirst />
    case '2':
      return state === <LevelSecond />
    case '3':
      return state === <LevelThird />
    case '4':
      return state === <LevelFourth />
    case '5':
      return state === <LevelFifth />
    case '6':
      return state === <LevelSixth />
    case '7':
      return state === <LevelSeventh />
    case '8':
      return state === <LevelEight />
    case '9':
      return state === <LevelNinth />
    case '10':
      return state === <LevelTenth />
    default:
      return state
  }
}

export default function App() {
  const [count, dispatch] = useReducer(reducer, initialState)
  const countContext = useContext(CountContext)
  return (<CountContext.Provider value={{ countContext: count, countDispatch: dispatch }}>
    {/* <View style={styles.container}> */}
    {count}
    <Button onPress={() => countContext.countDispatch('1')} title='Level 1' />
    <Button onPress={() => dispatch('2')} title='Level 2' />
    <Button onPress={() => countContext.countDispatch('3')} title='Level 3' />
    <Button onPress={() => countContext.countDispatch('4')} title='Level 4' />
    <Button onPress={() => countContext.countDispatch('5')} title='Level 5' />
    <Button onPress={() => countContext.countDispatch('6')} title='Level 6' />
    <Button onPress={() => countContext.countDispatch('7')} title='Level 7' />
    <Button onPress={() => countContext.countDispatch('8')} title='Level 8' />
    <Button onPress={() => countContext.countDispatch('9')} title='Level 9' />
    <Button onPress={() => countContext.countDispatch('10')} title='Level 10' />
    {/* </View> */}
  </CountContext.Provider>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
